/* ONE dark UI variables
** ---------------------------------------------- */
/* Official variables
** These variables must be defined in every theme
** Source: https://github.com/atom/atom/blob/master/static/variables/ui-variables.less
** ---------------------------------------------- */
/* Custom variables
** These variables are only used in this theme
** ---------------------------------------------- */
/* Packages variables
** These variables are used to override packages
** ---------------------------------------------- */
/* Debug
** Output variables to the top of the UI
** ------------------------------------- */
.atom-text-editor .gutter .go-plus-error {
  color: #ff6347;
}
.atom-text-editor .gutter .git-line-added.go-plus-error {
  color: #ff6347;
}
.atom-text-editor .gutter .git-line-modified.go-plus-error {
  color: #ff6347;
}
.atom-text-editor .gutter .git-line-removed.go-plus-error {
  color: #ff6347;
}
.goplus-error {
  background-color: #ec9393;
  color: #fa2500;
}
.goplus-warning {
  background-color: #dba970;
  color: #d39f50;
}
.highlight.uncovered .region {
  background-color: #d92626;
  opacity: 0.2;
}
.highlight.covered .region {
  background-color: #20b684;
  opacity: 0.2;
}
